import Design from "./3d-cube.svg";
import Analysis from "./analysis.svg";
import Development from "./internet.svg";

const Images = [
  {
    id: 0,
    src: `{ Design }`,
    description: "Design",
    name: "Design"
  },
  {
    id: 1,
    src: { Development },
    description: "Development",
    name: "Development"
  },
  {
    id: 2,
    src: { Analysis },
    description: "Analysis",
    name: "Analysis"
  }
];

export default Images;
